import React ,{Component}from 'react';
import { connect } from 'react-redux'
import {loadusersuccess} from '../action/index'


class Hello extends Component {

  render(){
    if (this.props.loading) {
      return <div>Loading</div>
   }
  //   if (this.props.error){
  //   return<div style={{color:'red'}}><center>Error:{this.props.error}</center></div>
  //   }
  return (
      <div>
      <center>
      <ul>   
            {this.props.user.map(u => (
          <li>Name:{u.myprofile.Name}<br></br>Age:{u.myprofile.Age}<br></br>Email:{u.myprofile.Email}</li>
        ))}
      </ul>
      </center>
      </div>
  );
}
}

const mapStateToProps = (state) => {
  
 return{ user: state.user,
   loading: state.loading}
  //  error: state.error,
  
};
const mapDispatchToProps = (dispatch) =>{
  return{loadusersuccess: () => dispatch (loadusersuccess())}
};
export default connect (mapStateToProps,mapDispatchToProps)(Hello);
